לטענת
העוררת מגולמת בעבירות המיוחסות למשיב חומרה רבה מאוד וטבועה בהן מסוכנות מופלגת;
מחומר הראיות והמפורט בכתב האישום עולה כי למשיב קשרים עם גורמים עבריינים מסוכנים
והוא שימש כחוליה ראשונה בשרשרת הסחר והשימוש בכלי הנשק; למשיב עבר פלילי שלא נלקח
בחשבון; ויש להורות על מעצר מלא של נאשמים בעבירות נשק כדי למגר את העבירות. מנגד
טען בא-כוח המשיב כי חלו תמורות מאז שהמשיב נעצר; עברו הפלילי הוא בעבירות בענייני
משפחה ולא בעבירות קשורות לנשק; נסיבות האירוע לא נחקרו עד תום והן אינן כפי
שמשתקפות על פני הדברים; המשיב היה רק שליח של אדם אחר ולא נשקפת ממנו מסוכנות;
תסקיר המעצר המעודכן חיובי; למשיב מצב נפשי בעייתי; החלופה מאיינת את המסוכנות;
ויש לתת משקל להחלטת הערכאה הדיונית שהתרשמה באופן בלתי אמצעי מהמפקחים המוצעים.
